import React from 'react';
export class Home extends React.Component { // Tell webpack this JS file uses this image



     constructor(props) {
       super(props);
     }


    render(){
        return (
            <div className="Home">
                <div className="Home">
                    <img src={require('../logothedre.png')} />
                </div>
            </div>
        );
    }
}

export default Home;
